import { Navbar, NavbarBrand } from 'reactstrap';
import './App.css';
import MenuComponent from './components/MenuComponent';

function App() {
  return (
    <div className="App">
        <Navbar dark color='primary' >
          <div className='container'>
            <NavbarBrand href='/'>This is navbarbrand</NavbarBrand>
          </div>
        </Navbar>
    </div>
  );
}

export default App;
